generated.css:
@font-face {
	font-family: Quicksand;
	src: url(7f6d65908be84cec5b4524e0636c6ed6.ttf);
	font-weight: 800;
}

@font-face {
	font-family: Roboto;
	scr: url(abb653cbc2312bccb31e766b7c7d42d5.ttf);
	font-weight: 800;
}

h1, h2, h3, h4, h5 {
	font-family: "Roboto";
}

body {
	text-align: center;
	font-size: 20px;
	padding: 2.5%;
	font-family: "Quicksand";
}

.profile {
	width:200px;
	height: 200px;
	border-radius: 100px;
}

.title-fade-out {
	opacity: 0;
	animation-name: fade-out;
	animation-duration: 1s;
}

.title-fade-in {
	opacity: 100;
	animation-name: fade-in;
	animation-duration: 1s;
}

@keyframes fade-out {
	from {opacity: 100}
	to {opacity: 0}
}

@keyframes fade-in {
	from {opacity: 0}
	to {opacity: 100}
}
